webpackJsonp([58],{25:function(s,n,a){s.exports=a(86),s.exports.template='<h1>XDC UI documentation</h1>\n<hr>\n<h1>Installation</h1>\n<pre><code class="language-shell">npm install xdc-ui --save\n</code></pre>\n<h1>Usage</h1>\n<p>Import all components</p>\n<pre><code class="language-javascript"><span class="hljs-keyword">import</span> Vue <span class="hljs-keyword">from</span> <span class="hljs-string">\'vue\'</span>;\n<span class="hljs-keyword">import</span> MintUI <span class="hljs-keyword">from</span> <span class="hljs-string">\'xdc-ui\'</span>;\n<span class="hljs-keyword">import</span> <span class="hljs-string">\'xdc-ui/lib/style.css\'</span>;\n\nVue.use(MintUI);\n</code></pre>\n<p>Or import on demand</p>\n<pre><code class="language-javascript"><span class="hljs-keyword">import</span> Cell <span class="hljs-keyword">from</span> <span class="hljs-string">\'xdc-ui/lib/cell\'</span>;\n<span class="hljs-keyword">import</span> <span class="hljs-string">\'xdc-ui/lib/cell/style.css\'</span>;\n\n<span class="hljs-keyword">import</span> Button <span class="hljs-keyword">from</span> <span class="hljs-string">\'xdc-ui/lib/button\'</span>;\n<span class="hljs-keyword">import</span> <span class="hljs-string">\'xdc-ui/lib/button/style.css\'</span>;\n\nVue.component(Cell.name, Cell);\nVue.component(Button.name, Button);\n</code></pre>\n<h2>Use <a href="https://github.com/QingWei-Li/babel-plugin-component">babel-plugin-component</a></h2>\n<p>Style sheet will be automatically imported</p>\n<pre><code class="language-javascript"><span class="hljs-keyword">import</span> Vue <span class="hljs-keyword">from</span> <span class="hljs-string">\'vue\'</span>;\n<span class="hljs-keyword">import</span> MintUI <span class="hljs-keyword">from</span> <span class="hljs-string">\'xdc-ui\'</span>;\n\nVue.use(MintUI);\n</code></pre>\n<p>import on demand</p>\n<pre><code class="language-javascript"><span class="hljs-keyword">import</span> Vue <span class="hljs-keyword">from</span> <span class="hljs-string">\'vue\'</span>;\n<span class="hljs-keyword">import</span> { Cell, Button } <span class="hljs-keyword">from</span> <span class="hljs-string">\'xdc-ui\'</span>;\n\nVue.component(Cell.name, Cell);\nVue.component(Button.name, Button);\n</code></pre>\n<p>Equals to</p>\n<pre><code class="language-javascript"><span class="hljs-keyword">var</span> Vue = <span class="hljs-built_in">require</span>(<span class="hljs-string">\'vue\'</span>);\n<span class="hljs-keyword">var</span> Cell = <span class="hljs-built_in">require</span>(<span class="hljs-string">\'xdc-ui/lib/cell\'</span>);\n<span class="hljs-built_in">require</span>(<span class="hljs-string">\'xdc-ui/lib/cell/style.css\'</span>);\n\n<span class="hljs-keyword">var</span> Button = <span class="hljs-built_in">require</span>(<span class="hljs-string">\'xdc-ui/lib/button\'</span>);\n<span class="hljs-built_in">require</span>(<span class="hljs-string">\'xdc-ui/lib/button/style.css\'</span>);\n\nVue.component(Cell.name, Cell);\nVue.component(Button.name, Button);\n</code></pre>\n<h2>Install <code>babel-plugin-component</code></h2>\n<pre><code class="language-shell">npm i babel-plugin-component -D\n</code></pre>\n<p>Configure .babelrc like this</p>\n<pre><code class="language-json">{\n  <span class="hljs-attr">"plugins"</span>: [<span class="hljs-string">"other-plugin"</span>, [<span class="hljs-string">"component"</span>, [\n    { <span class="hljs-attr">"libraryName"</span>: <span class="hljs-string">"xdc-ui"</span>, <span class="hljs-attr">"style"</span>: <span class="hljs-literal">true</span> }\n  ]]]\n}\n</code></pre>\n'},86:function(s,n){var a,l;s.exports=a||{},s.exports.__esModule&&(s.exports=s.exports["default"]),l&&(("function"==typeof s.exports?s.exports.options||(s.exports.options={}):s.exports).template=l)}});